import React from 'react';
import { Link } from 'react-router-dom';

function Navigation() {
  return (
    <nav>
        <Link to="/">My Exercises</Link>
        <Link to="../add-exercise">Add More Exercise</Link>
    </nav>
  );
}

export default Navigation;
